	public static void info(String info) {
		if (showInfo) {
			System.out.println(INFO_PREFIX + info);
		} else if (tracingLevel.ordinal() >= TracingLevel.INFO.ordinal()) {
			System.out.println(INFO_PREFIX + info);
		}
	}
	
	public static String toInfo(String info) {
		if (showInfo) {
			return INFO_PREFIX + info;
		} else if (tracingLevel.ordinal() >= TracingLevel.INFO.ordinal()) {
			return INFO_PREFIX + info;
		}
		return null;
	}

